// src/components/VideoTutorials.js
import React from 'react';

const VideoTutorials = () => {
  const videos = [
    {
      title: "Introduction to Accessibility",
      url: "https://www.youtube.com/embed/dQw4w9WgXcQ", // Replace with actual embed URL
    },
    {
      title: "Color Contrast Basics",
      url: "https://www.youtube.com/embed/dQw4w9WgXcQ", // Replace with actual embed URL
    },
    {
      title: "Understanding ARIA Roles",
      url: "https://www.youtube.com/embed/dQw4w9WgXcQ", // Replace with actual embed URL
    },
    {
      title: "Keyboard Navigation Tips",
      url: "https://www.youtube.com/embed/dQw4w9WgXcQ", // Replace with actual embed URL
    },
    {
      title: "Screen Reader Basics",
      url: "https://www.youtube.com/embed/dQw4w9WgXcQ", // Replace with actual embed URL
    },
    {
      title: "Creating Accessible Forms",
      url: "https://www.youtube.com/embed/dQw4w9WgXcQ", // Replace with actual embed URL
    },
    {
      title: "Color Contrast Analyzer",
      url: "https://www.youtube.com/embed/dQw4w9WgXcQ", // Replace with actual embed URL
    },
    {
      title: "Accessible Images",
      url: "https://www.youtube.com/embed/dQw4w9WgXcQ", // Replace with actual embed URL
    },
    {
      title: "Testing for Accessibility",
      url: "https://www.youtube.com/embed/dQw4w9WgXcQ", // Replace with actual embed URL
    },
    {
      title: "Building Accessible Navigation",
      url: "https://www.youtube.com/embed/dQw4w9WgXcQ", // Replace with actual embed URL
    },
  ];

  return (
    <section>
      <h2>Video Tutorials</h2>
      <div className="video-grid">
        {videos.map((video, index) => (
          <div key={index} className="video-item">
            <h3>{video.title}</h3>
            <iframe
              width="100%"
              height="200"
              src={video.url}
              title={video.title}
              frameBorder="0"
              allowFullScreen
            ></iframe>
          </div>
        ))}
      </div>
    </section>
  );
};

export default VideoTutorials;
